import React from "react";
import "./Footer.css"

function Footer() {
  return (
    <div>
      <nav className="footernav">
        <div>
            <p>Wallawaya Road,<br/>Pillewela,<br/>Buttala</p>
        </div>

        
            
        
      </nav>
    </div>
  );
}

export default Footer;
